import React from 'react'
import { Link } from 'react-router-dom'
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import { withStyles } from '@material-ui/core/styles';
import Select from '@material-ui/core/Select';
import createTheme from '@material-ui/core/styles';
import adatkezelesi from '../adatkezelesi.pdf';
import axios from 'axios'
import {useState, useEffect} from 'react'
import InputLabel from '@material-ui/core/InputLabel';
import {createMuiTheme, ThemeProvider} from '@material-ui/core';



const RentForm = () => {


  // Auto fills the form with user's details: 

  const vezetek_nev = localStorage.getItem('v_nev');
  const kereszt_nev = localStorage.getItem('k_nev');
  const telefon = localStorage.getItem('phone');

  //  Gets the car details... 

  useEffect(() => {
          fetchData();
      }, []);




    const [carInfo, setCarInfo] = useState([]);

    const fetchData = async() => {
          const car_data = await axios.get(`/api/modelljeink`);
          const car_info = await car_data.data.cars;
          setCarInfo(car_info);

    };


      let car_list = carInfo.filter(function (cars){
            return cars.car_category === category;
      })










//   MUI Selects Setup

  const [category, setCategory] = React.useState('');

  const handleCategory = (event) => {
    setCategory(event.target.value);
    
  };

















    console.log(car_list);

    return (
    <div className="rent_form_container">
      <form action="" className="rent_form">
        <br />
        <br />
        <input type="text" Placeholder="Vezetéknév" value={vezetek_nev} />
        <br />
        <input type="text" Placeholder="Keresztnév" value={kereszt_nev} />
        <br />
        <input type="text" Placeholder="Telefonszám" value={telefon} />
        <br />
        <br />
       <FormControl sx={{ m: 1, minWidth: 800 }}>
       
        <Select
          value={category}
          onChange={handleCategory}
          autoWidth
          displayEmpty>

          <MenuItem  value={''} disabled >Kategória</MenuItem>
          <MenuItem value={'Sedan'}>Sedan</MenuItem>
          <MenuItem value={'Kombi'}>Kombi</MenuItem>
          <MenuItem value={'Hibrid'}>Hibrid</MenuItem>
          <MenuItem value={'Furgon'}>Furgon</MenuItem>
        </Select>
        <br />
        <Select
          value={category}
          onChange={handleCategory}
          autoWidth
          displayEmpty>

          <MenuItem value={''} disabled >Modell</MenuItem>
          {car_list.map(car => (
            <MenuItem value={car.car_name}>{car.car_name}</MenuItem> ))}
        </Select>


      </FormControl>
        <br />
        <br />
        <label htmlFor="">Kölcsönzés kezdete:</label>
        <input type="date" pattern="(?:19|20)\[0-9\]{2}-(?:(?:0\[1-9\]|1\[0-2\])-(?:0\[1-9\]|1\[0-9\]|2\[0-9\])|(?:(?!02)(?:0\[1-9\]|1\[0-2\])-(?:30))|(?:(?:0\[13578\]|1\[02\])-31))"/>
        <br />
        <br />
        <label htmlFor="">Kölcsönzés vége:</label>
        <input type="date" pattern="(?:19|20)\[0-9\]{2}-(?:(?:0\[1-9\]|1\[0-2\])-(?:0\[1-9\]|1\[0-9\]|2\[0-9\])|(?:(?!02)(?:0\[1-9\]|1\[0-2\])-(?:30))|(?:(?:0\[13578\]|1\[02\])-31))"/>
        <br />
        <br />
        <label className="price_tag" htmlFor="">Ár: Kaució + 20000Ft</label>
        <br />
        <br />
        <input className="checkbox" type="checkbox"/>* Elfogadom az <a href={adatkezelesi}  rel="noopener noreferrer" target="_blank">adatkezelési nyilatkozatot.</a> 
        <br />
        <br />
        <button className="primary_button">Kölcsönzés ⯈</button>
        <br />
      </form>
    </div>
    )
}

export default RentForm
